import React from "react";

function Home() {
  return (
    <section className="relative bg-[#0f0f0f] text-white min-h-screen flex flex-col justify-center items-center">
      <div className="text-center relative">
      <img src="/img/logo.jpg" alt="Logo" />
        <h1 className="text-6xl font-bold text-[#ffcc70] relative z-0">
          Welcome to Our Portfolio
        </h1>
      </div>
    </section>
  );
}

export default Home;
